      <CardContent>
        <Typography variant="h4">
          ליצירת קשר
        </Typography>
        <Typography variant="h5" component="div">
          gililandau@gmail.com : במייל
        </Typography>
        <Typography variant="h5" component="div">
          0504102071 : בטלפון
          0545785151 : טלפון נוסף
        </Typography>
        </CardContent>
    </Card>
  );

}
export default Contact
